import './App.css';
import {BrowserRouter as Router , Switch,Route} from "react-router-dom";
import Home from './pages/Home';
import Cart from './pages/Cart';
function App() {
  return (
    <>

   <Router>
      <Switch>
       <Route path="/" exact component={Home} />
       <Route path="/cart" exact  component={Cart} />

     </Switch>
  </Router>





    </>
  );
}

export default App;
